import React,{useState,useEffect} from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView,KeyboardAvoidingView,Picker,TextInput,Platform,ScrollView} from 'react-native';
import {css} from '../assets/Css/css';

export default function Teste2 ({route}) {
    const[result,setResult] = useState(route.params?.transf.data[0].val_fuzz)
    const datas = [];

    for(var i; i <route.params?.transf.data[0].tam; i++){
        datas.push(route.params?.transf.data[i].data);
    }
    const Valores = {
        tableHead : ['Ativo'].concat(datas,['Recomendação'])
    }
    return (
        <SafeAreaView style = {css.fundo}>
            <View> <Text>{result}<Text> {datas}</Text></Text></View>
        </SafeAreaView>
    );
    
}
